import { Route, Routes } from "react-router-dom";
import "./App.css";
import Layout from "./components/Layout/Layout";
import Home from "./pages/Home";
import Tours from "./pages/Tours"


function App() {
  return <Routes>
  <Layout />;
  <Route path="/home" element={<Home/>}/>
  <Route path ="/tours" element={<Tours/>} />
</Routes>
}

export default App;

